-- Tabla de parametrizado
CREATE TABLE
    PARAMETRIZADO (
        ID INT IDENTITY (1, 1) PRIMARY KEY,
        SECTOR INT,
        SUBSECTOR INT,
        CARACTER INT,
        JURISDICCION INT,
        SUBJURISDICCION INT,
        ENTIDAD INT,
        OGESE INT,
        UNIDAD_EJECUTORA INT,
        PROGRAMA INT,
        SUBPROGRAMA INT,
        PROYECTO INT,
        ACTIVIDAD INT,
        OBRA INT,
        CUENTA_ESCRITURAL INT,
        MONEDA INT,
        FINALIDAD INT,
        FUNCION INT,
        INCISO INT,
        PARTIDA_PRINCIPAL INT,
        PARTIDA_PARCIAL INT,
        PARTIDA_SUBPARCIAL INT,
        CLAS_ECONOMICO INT,
        FUENTE_FINANCIERA INT,
        UBICACION_GEO INT,
        ACT_INT VARCHAR(50),
        DESCRIPCION VARCHAR(255),
        SANCION DECIMAL(15, 2),
        VIGENTE DECIMAL(15, 2),
        PREVENTIVO DECIMAL(15, 2),
        RESTRINGIDO DECIMAL(15, 2),
        DEFINITIVO DECIMAL(15, 2),
        RESERVA_COMPROMISO DECIMAL(15, 2),
        DEVENGADO DECIMAL(15, 2),
        PAGADO DECIMAL(15, 2),
        DISPONIBLE DECIMAL(15, 2),
        LIQUIDADO DECIMAL(15, 2),
        TOTAL_AFECTACION_PRE DECIMAL(15, 2),
        TOTAL_AFECTACION_DEF DECIMAL(15, 2),
        TOTAL_AFECTACION_DEV DECIMAL(15, 2),
            CONCATENADO_SF AS (
        CAST(
            COALESCE(CAST(PROGRAMA AS VARCHAR), '') + '-' +
            COALESCE(CAST(PROYECTO AS VARCHAR), '') + '-' +
            COALESCE(CAST(ACTIVIDAD AS VARCHAR), '') + '-' +
            COALESCE(CAST(OBRA AS VARCHAR), '0') + '-' +
            COALESCE(CAST(INCISO AS VARCHAR), '') + '-' +
            COALESCE(CAST(PARTIDA_PRINCIPAL AS VARCHAR), '') + '-' +
            COALESCE(CAST(PARTIDA_PARCIAL AS VARCHAR), '')
        AS VARCHAR(255))
    ) PERSISTED,
        PARTIDA_CALCULADA AS (
        COALESCE(CAST(PROGRAMA AS VARCHAR), '') + '-' + 
        COALESCE(CAST(SUBPROGRAMA AS VARCHAR), '') + '-' + 
        COALESCE(CAST(PROYECTO AS VARCHAR), '') + '-' + 
        COALESCE(CAST(ACTIVIDAD AS VARCHAR), '') + '-' + 
        COALESCE(CAST(OBRA AS VARCHAR), '')
    ) PERSISTED,
        INCISO_CALCULADO AS (
        COALESCE(CAST(INCISO AS VARCHAR), '') +  
        COALESCE(CAST(PARTIDA_PRINCIPAL AS VARCHAR), '') +  
        COALESCE(CAST(PARTIDA_PARCIAL AS VARCHAR), '') + 
        COALESCE(CAST(PARTIDA_SUBPARCIAL AS VARCHAR), '') 
    ) PERSISTED
--        FOREIGN KEY (CONCATENADO_SF) REFERENCES EQUIVALENCIAS (CONCATENADO),
--      FOREIGN KEY (CUENTA_ESCRITURAL) REFERENCES FF_CTA_ESC (CTA_ESCRITURAL)
    );

