CREATE TRIGGER TRG_Autorizantes_Insert
ON AUTORIZANTES
AFTER INSERT
AS
BEGIN
    SET NOCOUNT ON;

    -- Actualizar CODIGO_AUTORIZANTE asegurando unicidad
    UPDATE AUTORIZANTES
    SET CODIGO_AUTORIZANTE = CONCAT(i.OBRA, '-', 
                                    ISNULL((
                                        SELECT COUNT(*) 
                                        FROM AUTORIZANTES 
                                        WHERE OBRA = i.OBRA AND ID <= i.ID
                                    ), 0))
    FROM AUTORIZANTES a
    INNER JOIN INSERTED i ON a.ID = i.ID;
END;
GO
CREATE TRIGGER trg_Certificado_CheckMonto
ON CERTIFICADOS
AFTER INSERT, UPDATE
AS
BEGIN
    SET NOCOUNT ON;

    -- Verificar que ningún autorizante relacionado esté con AUTORIZACION_GG = 0
    IF EXISTS (
        SELECT 1
        FROM INSERTED i
        INNER JOIN AUTORIZANTES a
        ON i.CODIGO_AUTORIZANTE = a.CODIGO_AUTORIZANTE
        WHERE a.AUTORIZACION_GG = 0
    )
    BEGIN
        RAISERROR ('No se pueden agregar certificados a un autorizante sin autorizar.', 16, 1);
        ROLLBACK TRANSACTION;
        RETURN;
    END;

    -- Verificar que la suma de los montos totales de los certificados no exceda el monto autorizado
    IF EXISTS (
        SELECT 1
        FROM 
            (SELECT i.CODIGO_AUTORIZANTE, SUM(c.MONTO_TOTAL) AS SumaMontoCertificados
             FROM INSERTED i
             LEFT JOIN CERTIFICADOS c ON i.CODIGO_AUTORIZANTE = c.CODIGO_AUTORIZANTE
             GROUP BY i.CODIGO_AUTORIZANTE) AS CertificadosSuma
        INNER JOIN AUTORIZANTES a
        ON CertificadosSuma.CODIGO_AUTORIZANTE = a.CODIGO_AUTORIZANTE
        WHERE CertificadosSuma.SumaMontoCertificados > a.MONTO_AUTORIZADO
    )
    BEGIN
        RAISERROR ('La suma de los montos totales de los certificados excede el monto autorizado.', 16, 1);
        ROLLBACK TRANSACTION;
    END;
END;
GO
CREATE TRIGGER trg_Autorizante_CheckMonto
ON AUTORIZANTES
AFTER UPDATE
AS
BEGIN
    SET NOCOUNT ON;

    -- Verificar que el nuevo MONTO_AUTORIZADO no sea menor a la suma de MONTO_TOTAL de los certificados
    IF EXISTS (
        SELECT 1
        FROM INSERTED i
        INNER JOIN CERTIFICADOS c ON i.CODIGO_AUTORIZANTE = c.CODIGO_AUTORIZANTE
        GROUP BY i.CODIGO_AUTORIZANTE, i.MONTO_AUTORIZADO
        HAVING i.MONTO_AUTORIZADO < SUM(c.MONTO_TOTAL)
    )
    BEGIN
        RAISERROR ('El MONTO_AUTORIZADO no puede ser menor que la suma de los montos en certificados asociados.', 16, 1);
        ROLLBACK TRANSACTION;
        RETURN;
    END;
END;
