    AR.ID AS AREA_ID, 
    C.ID AS CONTRATA_ID
FROM 
    AUTORIZANTES AS A
INNER JOIN 
    OBRAS AS O ON A.OBRA = O.ID
INNER JOIN 
    ESTADOS_AUTORIZANTES AS E ON A.ESTADO = E.ID
INNER JOIN 
