    NUMERO,
    C.NOMBRE AS CONTRATA,
    AÑO,
    ETAPA,
    OBRA,
    B.NOMBRE AS BARRIO,
    DESCRIPCION,
    BD.AUTORIZADO_INICIAL,
    BD.AUTORIZADO_NUEVO,
    -- Suma calculada de MONTO_TOTAL de CERTIFICADOS
    (SELECT SUM(C.MONTO_TOTAL)
     FROM CERTIFICADOS AS C
     INNER JOIN AUTORIZANTES AS A2 ON C.codigo_autorizante = A2.codigo_autorizante
     WHERE A2.OBRA = O.ID) AS MONTO_CERTIFICADO
